retrait des objets ne peut avoir lieu que le matin de 7h00 à 9h30 tous les jours de la semaine dans l\'entrepôt situé derrière le bâtiment adminstratif.&lt;/p&gt;\r\n&lt;p&gt;Le retour se fait soit au même endroit sur la même plage horaire, soit à l\'accueil administratif.&lt;/p&gt;');
